import React from 'react'
import DashboardFooter from '../../components/dashboard/DashboardFooter'
import DashboardNavbar from './DashboardNavbar'
import { ParentContain } from '../../styles/dashboard'
import { useUIContext } from "../../context/ui";
import { Button, FormControl, Grid,  TextField, Typography } from '@mui/material';

const AddProducts = () => {
  const {barActive} = useUIContext();
  return (
    <>
    <DashboardNavbar/>
    <ParentContain barActive={barActive}>

      <Typography variant='h4' my={3} textAlign="center">Add New Products</Typography>

    <Grid container spacing={{ xs: 2, sm: 2, md: 2, lg: 2 }} p={3} >
                    <Grid item xs={12} sm={6}  md={6}><FormControl fullWidth> <TextField id="pname" label="Product Name" variant="outlined" /></FormControl></Grid>
                    <Grid item xs={12} sm={6}  md={6}> <FormControl fullWidth> <TextField id="psize" label="Product Size" variant="outlined" /></FormControl></Grid>
                    <Grid item xs={12} sm={6}  md={6}><FormControl fullWidth> <TextField id="pprice" label="Product Price" variant="outlined" /></FormControl></Grid>
                    <Grid item xs={12} sm={6}  md={6}> <FormControl fullWidth> <TextField id="pcategory" label="Product Category" variant="outlined" /></FormControl></Grid>
                    {/* <Grid item xs={12} sm={6}  md={6}> <FormControl fullWidth> <TextField id="pimage" label="Upload Image" variant="outlined" type='file'/></FormControl></Grid> */}
                    {/* <Grid item xs={12} sm={6}  md={6}> <FormControl fullWidth> <TextField id="pdescription" label="Product Description" variant="outlined" /></FormControl></Grid> */}
                    <Grid item xs={12}><FormControl fullWidth> <TextField  id="pdescription" label="Product Description" multiline rows={4} variant="outlined" fullWidth /></FormControl></Grid>
                    <Grid item xs={12}><Button  type="submit"  variant="contained" sx={{
                        padding:"10px 20px",
                    }}> Add Products</Button></Grid>
                </Grid>

    </ParentContain>
    <DashboardFooter/>
    </>
  )
}

export default AddProducts;
